import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import classes from './coment.module.css';
import { Container, Row, Col, Nav, Button, Navbar, Form, FormControl} from 'react-bootstrap';
import Dialogs from '../dialogs/dialogs';
const Coment = (props) => {
let dialogsData = [
    {id: 1, name: 'Artem'},
    {id: 2, name: 'Artem2'},
    {id: 3, name: 'Artem3'},
    {id: 4, name: 'Artem4'}
]
let dialogsElement = dialogsData 
    .map (dialogs => <Dialogs id={dialogsData[0].id} name={dialogsData[0].name}/>)
return (
    <Container>
            <Dialogs id={dialogsData[0].id} name={dialogsData[0].name}/>
            <Dialogs id={dialogsData[1].id} name={dialogsData[1].name}/>
            <Dialogs id={dialogsData[2].id} name={dialogsData[2].name}/>
            <Dialogs id={dialogsData[3].id} name={dialogsData[3].name}/>
    </Container>
    );
}
export default Coment;
